import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import { Grid, Typography } from '@mui/material';
import Bahco from '../../assets/img/bahco.png';
import Wikus from '../../assets/img/wikus.png';
import Fibra from '../../assets/img/fibra.png';
import Eberle from '../../assets/img/eberle.png';

const PartnersAndCustomers = () => {
  const parceiros = [
    { id: 1, image: Bahco, alt: 'Parceiro 1' },
    { id: 2, image: Wikus, alt: 'Parceiro 2' },
    { id: 3, image: Fibra, alt: 'Parceiro 3' },
    { id: 4, image: Eberle, alt: 'Parceiro 4' },
  ];

  const clientes = [
    { id: 1, image: Bahco, alt: 'Cliente 1' },
    { id: 2, image: Wikus, alt: 'Cliente 2' },
    { id: 3, image: Fibra, alt: 'Cliente 3' },
    { id: 4, image: Eberle, alt: 'Cliente 4' },
  ];

  return (
    <div sx={{ margin: '2rem 0' }}>
      <Grid container spacing={2}>
        <Grid item xs={12} md={6}>
          <div sx={{ marginBottom: '2rem' }}>
            <Typography variant="h6" gutterBottom>Parceiros da Hiperion</Typography>
            <Carousel showThumbs={false} infiniteLoop autoPlay swipeable emulateTouch>
              {parceiros.map(parceiro => (
                <div key={parceiro.id} sx={{ textAlign: 'center' }}>
                  <img src={parceiro.image} alt={parceiro.alt} />
                </div>
              ))}
            </Carousel>
          </div>
        </Grid>
        <Grid item xs={12} md={6}>
          <div>
            <Typography variant="h6" gutterBottom>Clientes</Typography>
            <Carousel showThumbs={false} infiniteLoop autoPlay swipeable emulateTouch>
              {clientes.map(cliente => (
                <div key={cliente.id} sx={{ textAlign: 'center' }}>
                  <img src={cliente.image} alt={cliente.alt} />
                </div>
              ))}
            </Carousel>
          </div>
        </Grid>
      </Grid>
    </div>
  );
};

export default PartnersAndCustomers;
